import React from 'react'

import bottle from '../assets/choppedBottle.png';


export default class MobileBottle extends React.Component {
    render() {
        return (
            <div id="footer-bottle-wrap">
                <img src={bottle} alt="green tea bottle" />
                <div id="bottle-text-mobile">
                    <ul>
                    <li>Natural source of caffine boosted with other minerals to improve brain functions</li>
                    <li>Healthier than coffee and speeds up metabolism</li>
                    <li>Loaded with antioxidants</li>
                    </ul>
                </div>
            </div>
        );
    }
};
